import React, { Component } from "react";
import Layout from "../components/MyLayout";

class ASDF extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <Layout page="ASDF">
        <h1>
          This is the form to create a new blog. You probably shouldn't be
          here...
        </h1>
      </Layout>
    );
  }
}

export default ASDF;
